import React from 'react';
import { Link } from 'react-router-dom';

class Browse extends React.Component {
  render() {
    return (
      <header class="header">
        <nav>
          <Link to="/">Home</Link>
          <span> | </span>
          <Link to="/about">About</Link>
          <span> | </span>
          <Link to="/projects">Projects</Link>
        </nav>
      </header>
    )
  }
}

export default Browse;
